import React from 'react';
import PropTypes from 'prop-types';

const MyTable = ({fulldata}) => {
	return (
		<div>
		{Object.keys(fulldata[0]).map((key, index) => (
		  <pre key={index}>
	{`{
		  Header: ${key},
		accessor: ${key},
	},`}
		  </pre>
		))}
	  </div>
	
	);
};

export default MyTable;
